import React, { Component } from 'react';
import {BrowserRouter as Router, Switch, Link, Route} from "react-router-dom";
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import CssBaseline from '@material-ui/core/CssBaseline';
import Home from "./Home";
import CompanyList from "./CompanyList";
import Session from "./Session";
import Page from "./Page";
import Footer from "./Footer";

const page404 = () => <div><h1>404</h1>存在しないページです</div>  //<= ヒットしなかった時用のページを追加

let routeObj = "";
let routeObjAry = [];

let jsonList = require("./json/2021-01/CompanyList.json");

export default class Menu extends Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route path='/' exact component={Home} />
          <Route path='/companylist' exact component={CompanyList} />
          <Route path='/session' exact component={Session} />
          {jsonList.map((data, index) => (
            <Route
              path={'/2021-01/'+data.id}
              render={props => <Page id={data.id} file={data.company} {...props} />}
            />
          ))}
          <Route exact component={page404} />
        </Switch>
      </Router>
    );
  }
}
